import React, {useEffect} from 'react';
import EventsList from './events/EvensList';

function App() {
  const q = React.useState([]);

  const events = [
    {
      id: 1,
      name: "Coldplay Live",
      description: "This is an amazing concert this is happening in a big stadium"
    },
    {
      id: 2222,
      name: "Real Madrid VS. Barcelona",
      description: "El Clasico is the term used to refer to football matches between Spain’s most famous and bitterest rivals: FC Barcelona and Real Madrid C.F. The two teams meet twice during a season, with an additional two times in the Copa del Rey, Champions League, and the Supercopa de España, and possibly in the UEFA Super Cup as well."
    }
  ]

  return (
    <div className="wrapper">
      <h1>Upcoming events</h1>
      <EventsList events={events}/>
    </div>
  );
}

export default App;
